import React, { useState } from 'react';
import { apiPost } from './api';

export default function AddCitizenForm() {
  const [form, setForm] = useState({
    nationalId: '',
    fullName: '',
    dateOfBirth: '',
    gender: '',
    areaName: '',
    areaType: '',
    householdAddress: '',
    isHead: false,
    hasCriminalRecord: false,
    setWanted: false,
    setQuanChe: false
  });
  const [msg, setMsg] = useState('');
  const [err, setErr] = useState('');

  const change = (e) => {
    const { name, type, value, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
  };

  const submit = async (e) => {
    e.preventDefault();
    setMsg(''); setErr('');
    try {
      const data = await apiPost('/api/citizens', form);
      setMsg(`✅ Thêm thành công (CitizenID: ${data?.data?.CitizenID ?? 'N/A'})`);
      setForm({
        nationalId: '', fullName: '', dateOfBirth: '', gender: '',
        areaName: '', areaType: '', householdAddress: '',
        isHead: false, hasCriminalRecord: false, setWanted: false, setQuanChe: false
      });
    } catch (error) { setErr(error.message); }
  };

  return (
    <form onSubmit={submit} style={{ display:'grid', gap:10, maxWidth:600 }}>
      {msg && <div style={{ color:'green' }}>{msg}</div>}
      {err && <div style={{ color:'red' }}>{err}</div>}

      <label>CCCD
        <input name="nationalId" maxLength={12} value={form.nationalId} onChange={change} required />
      </label>
      <label>Họ tên
        <input name="fullName" value={form.fullName} onChange={change} required />
      </label>
      <label>Ngày sinh
        <input type="date" name="dateOfBirth" value={form.dateOfBirth} onChange={change} />
      </label>
      <label>Giới tính
        <select name="gender" value={form.gender} onChange={change}>
          <option value="">--Chọn--</option>
          <option value="Nam">Nam</option>
          <option value="Nữ">Nữ</option>
          <option value="Khác">Khác</option>
        </select>
      </label>
      <label>Khu vực (Area Name)
        <input name="areaName" value={form.areaName} onChange={change} required />
      </label>
      <label>Loại khu vực (Area Type)
        <select name="areaType" value={form.areaType} onChange={change} required>
          <option value="">--Chọn--</option>
          <option value="Thôn">Thôn</option>
          <option value="Tổ">Tổ</option>
        </select>
      </label>
      <label>Địa chỉ hộ
        <input name="householdAddress" value={form.householdAddress} onChange={change} required />
      </label>

      <label><input type="checkbox" name="isHead" checked={form.isHead} onChange={change} /> Chủ hộ</label>
      <label><input type="checkbox" name="hasCriminalRecord" checked={form.hasCriminalRecord} onChange={change} /> Có tiền án/tiền sự</label>
      <label><input type="checkbox" name="setWanted" checked={form.setWanted} onChange={change} /> Gắn Truy nã</label>
      <label><input type="checkbox" name="setQuanChe" checked={form.setQuanChe} onChange={change} /> Gắn Quản chế</label>

      <button type="submit" style={{ marginTop: 8 }}>Thêm công dân</button>
    </form>
  );
}
